    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `CheckDateIsAvailable` (IN `c_locationId` INT, IN `c_date` DATE, OUT `isAvailable` TINYINT(1))   BEGIN
	DECLARE existingLocationId INT;
	
	SELECT locationId INTO existingLocationId
  FROM Events
  WHERE locationId = c_locationId AND date = c_date
  LIMIT 1;

  IF existingLocationId IS NOT NULL THEN
      SET isAvailable = 0;
  ELSE
	    SET isAvailable = 1;
	END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `DeleteEvent` (IN `eventId` INT)   BEGIN
	DECLARE paymentId INT;
	
	SELECT R.paymentId INTO paymentId
	FROM Reservations AS R
	WHERE R.eventId=eventId;
	
	-- Delete Payment
	DELETE FROM Payments AS P
	WHERE P.paymentId = paymentId;
	
	-- Reservation is deleted on cascade
	
	-- Delete Event
	DELETE FROM Events AS E
	WHERE E.eventId=eventId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ReserveEvent` (IN `p_locationId` INT, IN `p_eventName` VARCHAR(50), IN `p_eventDescription` VARCHAR(200), IN `p_eventDate` DATE, IN `p_theme` VARCHAR(50), IN `p_guestCount` INT, IN `p_reservationDateTime` DATETIME, IN `p_paymentAmount` INT, IN `p_paymentDateTime` DATETIME, IN `p_userId` INT)   BEGIN
    DECLARE existingLocationId INT;
    DECLARE paymentId INT;
    DECLARE eventId INT;
    DECLARE reservationId INT;

    -- Check if the location is available to be reserve in the specified date
    SELECT locationId INTO existingLocationId
    FROM Events
    WHERE locationId = p_locationId AND date = p_eventDate
    LIMIT 1;

    IF existingLocationId IS NOT NULL THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Location is already reserved for the specified date.';
    ELSE
		    -- Insert Payment record
        INSERT INTO Payments (paymentAmount, paymentDateTime)
        VALUES (p_paymentAmount, p_paymentDateTime);
        
        SET paymentId = LAST_INSERT_ID();
		    
		    -- Insert Event record
        INSERT INTO Events (locationId, eventName, eventDescription, date, theme, guestCount)
        VALUES (p_locationId, p_eventName, p_eventDescription, p_eventDate, p_theme, p_guestCount);
        
        SET eventId = LAST_INSERT_ID();

        -- Insert Reservation record
        INSERT INTO Reservations (userId, eventId, reservationDateTime, paymentId)
        VALUES (p_userId, eventId, p_reservationDateTime, paymentId);

        SET reservationId = LAST_INSERT_ID();

        
    END IF;
END$$

